import Sidebar from '../components/Sidebar';
import Layout from '../components/Layout';
export default () => (
	<Layout>
		<div className="flex h-8-px bg-white pl-4 border-b-2 border-gray-300 items-stretch">
			<div className="self-center">
				<img className="h-8 w-8" src="./assets/icons/search.svg" alt="" />{' '}
			</div>
		</div>
	</Layout>
);
